import './App.css';
import Contador from './components/Contador';
import Temperatura from './components/Temperatura';
import  Formulario from './components/Formulario';
import {
  BrowserRouter as Router,
  Switch,
  Link,
  Route,
} from 'react-dom'

function App() {
  return (
   <Router>
     <Switch>
      <Route path='/contador'>
      <Contador></Contador>
      </Route>
      <Route path='/temperatura'>
      <Temperatura/>
      </Route>
      <Route path='/formulario'>
      <Formulario/>
      </Route>




     </Switch>



   </Router>
  );
}

export default App;
